1. 简化分母，使其以10的幂的形式存在。
2. 将分子除以简化后的分母。

首先，让我们重写分母 \(2^2 \cdot 5^7\)。我们可以将其表示为 \(2^2 \cdot 5^2 \cdot 5^5 = (2 \cdot 5)^2 \cdot 5^5 = 10^2 \cdot 5^5\)。因此，分数变为：
\[
\frac{21}{10^2 \cdot 5^5} = \frac{21}{100 \cdot 3125}
\]

然而，一个更简单的方法是直接将分数转换为十进制。为此，我们可以将分母重写为10的幂。注意到 \(2^2 \cdot 5^7 = 4 \cdot 78125 = 312500\)，但这个方法更复杂。相反，让我们直接将分子和分母除以2和5，直到分母是10的倍数。

